loadingState.value:
{{queries.insert_event.isLoading === true || queries.discord_server.isLoading === true
|| queries.fetch_color.isLoading === true || queries.discord_access.isLoading === true
? true : false}}

options.query:
DO $$ 
DECLARE
    current_date1 TIMESTAMP := '{{components.form1.data.datepicker2.value}}T{{components.form1.data.dropdown2.selectedOptionLabel}}:00'::timestamp; 
    current_date2 TIMESTAMP := '{{components.form1.data.datepicker3.value}}T{{components.form1.data.dropdown1.selectedOptionLabel}}:00'::timestamp; 
    title TEXT := '{{components.form1.data.dropdown10.value}}';
    creator TEXT := '{{queries.fetch_users.data[0].email}}';
    color TEXT := '{{queries.fetch_color.data[0].color}}';
    group_id INTEGER;
    end_rec TIMESTAMP := '{{components.form1.data.datepicker1.value}}T23:59:59'::timestamp;
    monthly BOOLEAN := '{{components.form1.data.checkbox1.value}}';
    server TEXT := '{{queries.fetch_color.data[0].color}}';

BEGIN
    SELECT nextval('group_id_sequence') INTO group_id;

    INSERT INTO calendar_event (start, "end", title, creator, color, group_id, end_rec, monthly, server)
    SELECT 
        d::timestamp, 
        current_date2 + (d - current_date1)::interval,
        title, 
        creator, 
        color,
        group_id,
        end_rec,
        monthly,
        server

    FROM generate_series('{{components.form1.data.datepicker2.value}}T{{components.form1.data.dropdown2.selectedOptionLabel}}:00'::timestamp, '{{components.form1.data.datepicker1.value}}T23:59:59'::timestamp, '1 month'::interval) d;
END $$;

INSERT INTO users_calendar (email, color)
VALUES (
    '{{queries.discord_access.data.email}}',
    (
        SELECT '#' || substring(md5(random()::text), 1, 6)
        WHERE NOT EXISTS (
            SELECT 1 FROM users_calendar WHERE color = '#' || substring(md5(random()::text), 1, 6)
        )
        LIMIT 1
    )
);

